import NavBar from "../NavBar";

function HomePage(){
    return (
        <div className="home bg-[#443C68]">
            <NavBar/>
            {/* left/top side of screen  */}
            <div className="bg-[#393053] h-[33%] flex justify-center border-b-2 border-b-white-500 lg:w-[33%] lg:h-[93%] lg:border-r-white">
                {/* div containing image  */}
                <div className=" shadow-2xl img-con absolute h-[300px] w-[255px] bg-[#18122B] top-[17%]">

                </div>
            </div>

            {/* right/down side of screen with content  */}
            <div className="h-[60%] flex flex-col justify-center relative">
                <div className="h-[50%] mt-[160px] mb-[15px] pb-0">
                    <p className="text-white text-3xl text-center">Hi, I'm Shreya Kumar!</p>
                    <p className="text-white text-xl">Software Developer</p>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
